original_question:
$z = 2 + \sqrt{2} - (3 + 3 \sqrt{2})i$ ಮತ್ತು $c = 2 - 3i$ ಎಂದು ತೆಗೆದುಕೊಳ್ಳಿ. $z$ ಅನ್ನು $c$ ಸುತ್ತ $\frac{\pi}{4}$ ಎಡಗಡೆ ತಿರುಗಿಸಿದಾಗ $w$ ಫಲಿತಾಂಶವಾಗುತ್ತದೆ.

[asy]
unitsize(0.6 cm);

pair C, W, Z;

Z = (2 + sqrt(2), -3 - 3*sqrt(2));
C = (2,-3);
W = rotate(45,C)*(Z);

draw(Z--C--W);

dot("$c$", C, N);
dot("$w$", W, SE);
dot("$z$", Z, S);
label("$\frac{\pi}{4}$", C + (0.6,-1));
[/asy]

$w$ ಅನ್ನು ಕಂಡುಹಿಡಿಯಿರಿ.

